(function() {
  $(document).on('ready page:load', function() {
    $("#import_users_form input[type='checkbox']").change(function() {
      if (this.checked) {
        return $(this).siblings(".import-label").text("add contact");
      } else {
        return $(this).siblings(".import-label").text("skip contact");
      }
    });
    $("#import-contacts-button").click(function() {
      if (!$("#import_users_form").valid()) {
        return false;
      }
    });
    return $("#import_users_form").validate({
      ignore: [],
      errorClass: "has-error help-block",
      rules: {
        "imports": {
          required: function(element) {
            var boxes;
            boxes = $(".import-checkbox");
            if (boxes.filter(":checked").length === 0) {
              return true;
            }
            return false;
          },
          minlength: 1
        }
      },
      messages: {
        "imports": "Please select at least one contact."
      },
      errorPlacement: function(error, element) {
        console.log(error);
        return error.appendTo($("#import-form-error"));
      }
    });
  });

}).call(this);
