/* Newsletter */
$('.contact_form_wrap .contact_form').each( function(){
	var form = $(this);
	//form.validate();
	form.submit(function(e) {
		if (!e.isDefaultPrevented()) {
			jQuery.post(this.action,{
				'email':$('input[name="cf_email"]').val(),
			},function(data){
				form.fadeOut('fast', function() {
					$(this).siblings('p').show();
				});
			});
			e.preventDefault();
		}
	});
});	
